import React from "react";

function AddGrocery({ addItem, value, setValue }) {
  return (
    <div>
      <form onSubmit={addItem}>
        <input type="text" placeholder="Add Grocery" value={value} />
        <button>Add</button>
      </form>
    </div>
  );
}

export default AddGrocery;
